idth":1000,"height":850,"size":375598}],"embeds":[],"timestamp":"2018-05-10T23:17:32.050000+00:00","edited_timestamp":null,"reactions":[{"count":4,"emoji":{"name":"\ud83d\udc4d"}},{"count":3,"emoji":{"name":"\u2705"}}],"content":"Besser?","author":505,"s":59408,"mentions":[]},{"id":"444277187718152193","attachments":[{"url":"https://cdn.discordapp.com/attachments/441253237132230656/444277187718152192/Merkels_Neuland.jpg","proxy_url":"https://media.discordapp.net/attachments/441253237132230656/444277187718152192/Merkels_Neuland.jpg","width":980,"height":1272,"size":589806}],"embeds":[],"timestamp":"2018-05-10T23:18:55.823000+00:00","edited_timestamp":null,"reactions":[{"count":1,"emoji":{"name":"\ud83e\udd14"}}],"content":"via Wikipedia wurde das obere Bild zur Bearbeitung vorgeschlagen...Meinungen dazu? \ud83d\ude09","author":505,"s":59409,"mentions":[]},{"id":"444368778030088193","attachments":[{"url":"https://cdn.discordapp.com/attachments/441253237132230656/444368778030088192/Spruch_Keine_Angst.jpg","proxy_url":"https://media.discordapp.net/attachments/441253237132230656/444368778030088192/Spruch_Keine_Angst.jpg","width":800,"height":800,"size":72589}],"embeds":[],"timestamp":"2018-05-11T05:22:52.655000+00:00","edited_timestamp":null,"reactions":[{"count":2,"emoji":{"name":"\ud83e\udd14"}},{"count":2,"emoji":{"name":"\ud83d\udc4d"}}],"content":"Ich habe mal ein Bild f\u00fcr den strategischen Einsatz gemacht. Ihr k\u00f6nnt es beliebig verwenden. Damit es richtig eingesetzt wird, solltet ihr verstehen, was dahinter steckt:\r\n\r\nDas Gesch\u00e4ftsmodell rechtsnationaler Gruppen ist Angst. Angst, die die rechten Vordenker ihrem Fu\u00dfvolk machen, damit dieses dann angest\u00fcrmt kommt, sich um sie schart und wimmert: \"Bitte besch\u00fctzt uns!\" Rechtsnationale Vordenker agieren wie Drogenbarone: Sie selbst nehmen keine Drogen. Oder glaubt ihr wirklich, dass irgendjemand in der AfD-F\u00fchrungsetage wirklich glaubt, der Islam bedrohe die freie Welt?\r\n\r\nDas Bild ist f\u00fcr das Posten in Hassdiskussionen gedacht, mitten hinein ins Trollgebell. Es sollte unbedingt OHNE KOMMENTAR eingestellt werden! Die Funktion ist NICHT, den Trollen die Angst vor dem zu nehmen, was sie angeblich bedroht. Es geht darum, Denkprozesse anzuleiern, denn genau diese versuchen die Vordenker, beim Fu\u00dfvolk zu verhindern. Es ist bewusst kein Bild enthalten, um den Fokus auf den Text zu richten. Der Text ist absichtlich vage und missverst\u00e4ndlich abgefasst. Die Absicht ist eine zweistufige Reaktion, die bei den Trollen ausgel\u00f6st werden soll: Stufe 1: \"Was soll der Quatsch?\" Stufe 2: \"Wer wird wem nichts tun?\". \r\n\r\nDas strategische Ziel des Memes (wie ist die Einzahl von Memes? Mem? Memo?) ist, Trolle mit der Erfahrung zu konfrontieren, sich wieder eigenst\u00e4ndig Gedanken \u00fcber etwas zu machen.","author":501,"s":59410,"mentions":[]},{"id":"444372357033885710","attachments":[{"url":"https://cdn.discordapp.com/attachments/441253237132230656/444372357033885708/Spruch_Keine_Angst_-_Twitter_Version.jpg","proxy_url":"https://media.discordapp.net/attachments/441253237132230656/444372357033885708/Spruch_Keine_Angst_-_Twitter_Version.jpg","width":1080,"height":610,"size":72559}],"embeds":[],"timestamp":"2018-05-11T05:37:05.956000+00:00","edited_timestamp":null,"reactions":[{"count":1,"emoji":{"name":"\ud83e\udd14"}}],"content":"Hier noch die Twitter-Version","author":501,"s":59411,"mentions":[]},{"id":"444373614905655316","attachments":[],"embeds":[],"timestamp":"2018-05-11T05:42:05.856000+00:00","edited_timestamp":null,"reactions":[{"count":1,"emoji":{"name":"all_the_things"}}],"content":"Ihr solltet das Bild in so vielen Diskussionen wie m\u00f6glich posten, damit es richtig nervt. Um so mehr Gedanken machen sich die Trolle dar\u00fcber.","author":501,"s":59412,"mentions":[]},{"id":"444379244005556225","attachments":[],"embeds":[],"timestamp":"2018-05-11T06:04:27.938000+00:00","edited_timestamp":null,"content":"\u003c@440
